import React , {useEffect , useState} from 'react'
import axios from 'axios'
import styles from './App.css'

function App() {

  let [restaurants,setRestaurants] = useState ([])

  useEffect(()=>{
    axios.get(`https://www.swiggy.com/dapi/restaurants/list/v5?lat=17.37240&lng=78.43780&is-seo-homepage-enabled=true&page_type=DESKTOP_WEB_LISTING`)
    .then((res)=>{
     setRestaurants(res.data.data?.cards[1]?.card?.card?.gridElements?.infoWithStyle?.restaurants)
    })

  },[])
  console.log(restaurants)
  return (
    <div class = "container-fluid">
      <div class = "row">
      <div class = "col-3">

      </div>

      <div class="col-9">
        <div class="row row-cols-1 row-cols-md-3 g-4">
          {restaurants.map((item , i)=>{
            return <div class="col">
            <div class="card h-100">
              <img src="..." class="card-img-top" alt="..." />
              <div class="card-body">
                <h5 class="card-title">{item.info.name}</h5>
                <p class="card-text">This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
              </div>
            </div>
          </div>
          })}

        </div>
      </div>
    </div>
  </div>)
}

export default App


